import React from 'react';
import Button from './Button';

const SIPGiftCommon = (props) => {
    return (<>
        <main>
            <div className="container-fluid d-flex justify-content-center align-items-center flex-column" id="GiftMain">
                <img src={props.src} alt="Gift" className="mb-md-2 mb-5" />
                <h4 className="text-center">{props.text}</h4>
                <Button text="Send your first gift" />
            </div>
        </main>
    </>)
}

export default SIPGiftCommon;
